    @Test
    public void getRepeatFileName() {
        List<HanyiBean> hanyiBeans = JSON.parseArray(SOURCE_STR, HanyiBean.class);
        Map<String, String> map = new HashMap<>();
        for (int i = 0; i < hanyiBeans.size(); i++) {
            // 当没有该名字时，存入 map 之中
            if (map.get(hanyiBeans.get(i).getProductName()) == null) {
                map.put(hanyiBeans.get(i).getProductName(), hanyiBeans.get(i).getProductFileUrl());
            } else {
                System.out.println("-------");
                System.out.println(map.get(hanyiBeans.get(i).getProductName()));
                System.out.println(hanyiBeans.get(i).getProductName() + " " + hanyiBeans.get(i).getProductFileUrl());
                System.out.println("-------");
            }
        }
    }

    /**
     * 从汉仪官网获取所有字体信息的 json 数据
     */
    @Test
    public void testGetJsonFromHanyiWeb() {
        // 创建 HTTPClient 对象
        CloseableHttpClient httpClient = HttpClients.createDefault();

        String resultJson = "";
        String url = "http://www.hanyi.studio/hanyiwebsite/fontmanagement/fontmanagerhandler.ashx?tags=";
        CloseableHttpResponse response = null;

        try {
            URIBuilder builder = new URIBuilder(url);

            /* 添加请求参数
            builder.addParameter("Origin", "http://www.hanyi.com.cn");
            builder.addParameter("Referer", "http://www.hanyi.com.cn/productList.php");
            builder.addParameter("User-Agent", "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/73.0.3683.75 Safari/537.36");
            */

            URI uri = builder.build();

            // 创建 http Get 请求
            HttpGet httpGet = new HttpGet(uri);

            httpGet.addHeader("Origin", "http://www.hanyi.com.cn");
            httpGet.addHeader("Referer", "http://www.hanyi.com.cn/productList.php");
            httpGet.addHeader("User-Agent", "Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/73.0.3683.75 Safari/537.36");
            // 执行返回请求
            response = httpClient.execute(httpGet);

            // 判断返回状态是否为200
            if (response.getStatusLine().getStatusCode() == 200) {
                resultJson = EntityUtils.toString(response.getEntity(), "UTF-8");
                System.out.println(resultJson);
            }
        } catch (URISyntaxException e) {
            e.printStackTrace();
            // URIBuilder
        } catch (ClientProtocolException e) {
            e.printStackTrace();
            // 执行请求
        } catch (IOException e) {
            e.printStackTrace();
        } finally {
            try {
                if (response != null) {
                    response.close();
                }
                httpClient.close();
            } catch (IOException e) {
                e.printStackTrace();
            }
        }
    }
